        KeyMainAscll[i]=KeyMainlist[i].charCodeAt()
    }
    let Passwordlist=data.split('')
    let PasswordAscll=[ ]
    for(let i=0;i<=PasswordAscll.length-1;i++){
        PasswordAscll[i]=Passwordlist[i].charCodeAt()
    }    
   
    

}
export default KeyMain
